#include <stdio.h>
#include <string.h>
#include <unistd.h>
#include <button.h>
#include <timer.h>
#include <internal/ota.h>

#define Yes 0
#define No 1

/* Configuration Setting */
// Since console.rs capsule sends unnecessary strings (e.g., $tock) to an external tool(e.g., python) via UART, it prevents them from communicating with each other correctly
// Furthermore, it is difficult to debug Ota_app without printf() and debug!()
// So, for convinience, we test Ota_app with button version before testing Ota_app with UART version
#define OTA_BUTTON_VERSION Yes
#define OTA_DEBUG No

/* Buffer Size */
#define UART_READ_BUFFER_SIZE 517
#define FLASH_BUFFER_SIZE 512
#define RESPONSE_BUFFER_SIZE 20
#define REGION_BUFFER_SIZE 4

/* Command set from the tool to OTA app*/
#define COMMAND_FIND_STADDR 0x5A
#define COMMAND_WRITE_BINARY_DATA 0x5B
#define COMMAND_WRITE_PADDING_BOUNDARY 0x5C
#define COMMAND_WRITE_PADDING_APP 0x5D
#define COMMAND_SEND_CRC 0x5E
#define COMMAND_APP_LOAD 0x5F
#define COMMAND_APP_ERASE 0x60

/* Others */
#define MIN_TBF_HEADER_LENGTH 16
#define INVALID_TBF_HEADER -10
#define TBF_BASE_HEADER_CHECKSUM_INDEX 12
#define TBF_BASE_HEADER_CHECK_OFFSET 4

#if (OTA_DEBUG == Yes)
#define COMMAND_DEBUG 0x61
#endif

/* Data structure to control OTA update */
typedef struct OtaDataPkt
{
  bool ota_boDone;
  uint8_t ota_u8uart_read_buf[UART_READ_BUFFER_SIZE];
  uint8_t ota_u8uart_write_buf[UART_READ_BUFFER_SIZE];
  uint8_t ota_u8flash_write_buf[FLASH_BUFFER_SIZE];
  uint8_t ota_u8flash_read_buf[FLASH_BUFFER_SIZE]; // I left this buffer for future work, although it is not necessary for now
  uint32_t ota_u32process_index;
  uint32_t ota_u32supported_process_num;
  uint32_t ota_u32flash_start_address_dyn;
  uint32_t ota_u32rom_start_address_const;
  uint32_t ota_u32rom_end_address_const;
  uint32_t ota_u32crc;
  uint32_t ota_u32Crc32_kernel;
  uint32_t ota_u32recv_app_size;
  uint32_t ota_u32kernel_version;
  uint32_t ota_u32padding_app_header_len;
} stOtaDataPkt;

typedef struct ProcRegion
{
  uint32_t ota_u32start_address;
  uint32_t ota_u32size;
} stProcRegion;

/* Global Data structure definition */
stOtaDataPkt Ota_Dtat_Packet;
stProcRegion Ota_Proc_Region[REGION_BUFFER_SIZE];

