void ota_flash_state_machine(void)
{

  volatile int ret = 0;
  volatile uint8_t u8Cmd_Decoder = Ota_Dtat_Packet.ota_u8uart_read_buf[0]; // position 0 represents commnad from the tool
  // printf("Command: %x", u8Cmd_Decoder);
  switch (u8Cmd_Decoder)
  {
  case COMMAND_FIND_STADDR:
    ota_get_dynamic_value_init_response();
    // ota_putnstr_async(rsp_find_staddr_ok, RESPONSE_BUFFER_SIZE, nop_callback, NULL);
    break;

  case COMMAND_WRITE_BINARY_DATA:
    ota_write_data_into_flash_response();
    break;

  case COMMAND_WRITE_PADDING_BOUNDARY:
    ota_write_padding_boundary_response();
    break;
  case COMMAND_SEND_CRC:
    ota_crc_consistency_check_response();
    break;

  case COMMAND_APP_LOAD:
    ota_app_loading_request_response();
    break;

  case COMMAND_APP_ERASE:
    ota_erase_loaded_app_response();
    break;

  case COMMAND_WRITE_PADDING_APP:
    ota_write_padding_apps_response();
    break;

// After completing loading an app, you can print out data you want to see
// You need to modify states in the python tool (e.g., Appload -> Debug -> Success)
#if (OTA_DEBUG == Yes)
  case COMMAND_DEBUG:
    // printf("dyn_addr: %lx, proc_index: %ld\n", Ota_Dtat_Packet.ota_u32flash_start_address_dyn, Ota_Dtat_Packet.ota_u32process_index);
    for (int i = 0; i < 4; i++)
    {
      printf("addr: %lx size: %lx, ", Ota_Proc_Region[i].ota_u32start_address, Ota_Proc_Region[i].ota_u32size);
    }
    printf("\n");

    break;
#endif

  default:
    break;
  }

  // set call back for reading next uart data
  ret = ota_uart_data_read_cb_entry(UART_READ_BUFFER_SIZE);
  if (ret < 0)
  {
    printf("\tConsole Read Data Call Back Setting Failure!\n");
  }
}

// Main function
int main(void)
{
  volatile int ret = 0;

#if (OTA_BUTTON_VERSION == Yes)
  ret = ota_button_init();
  if (ret != 0)
  {
    printf("Error: %d\n", ret);
    return -1;
  }
#endif

  ret = ota_get_const_value_init(&Ota_Dtat_Packet);
  if (ret != 0)
    return -1;

  ret = ota_buffer_set_init(&Ota_Dtat_Packet);
  if (ret != 0)
    return -1;

  ret = ota_callback_subscribe_init();
  if (ret != 0)
    return -1;

#if (OTA_BUTTON_VERSION == No)
  // set call back to receive initial uart data
  ret = ota_uart_data_read_cb_entry(UART_READ_BUFFER_SIZE);
  if (ret != 0)
    return -1;
#endif

  return 0;
}
